import './Card.css';

const Card = ({img ,heading , details })=>{
    return(
<div className='card'>
    <img  src={img}/>
    <span>{heading}</span>
    <span>{details}</span>
    <button className='btn c-btn'>Learn Here</button>
</div>
    );
}
export default Card ;
